import React from "react";
import logo from "../img/logo.png";
import './Navbar.css';
import { Link } from "react-router-dom";

export default function Navbar() {
    return (
        <div className="navbar">
            <img src={logo} alt="" />
            <ul className="nav-menu">
                <Link to="/signup">
                    <li>SignUp</li>
                </Link>
                <Link href="/signin">
                    <li>SignIn</li>
                </Link>
                <Link href="/profile">
                    <li>Profile</li>
                </Link>
            
            
        </ul>
    </div>
    );
}
